// LogoutButton.js
import React from "react";
import { connect } from "react-redux";
import { logout } from "../redux/actions/auth";

const LogOut = ({ logout }) => {
  const handleLogout = () => {
    logout();
  };

  return <button onClick={handleLogout}>Logout</button>;
};

export default connect(null, { logout })(LogOut);
